import React, { Component } from "react";
import { FaRegBookmark, FaBookmark } from "react-icons/fa";

class IsBookMarkDetail extends Component {
  render() {
    return (
      <div>
        <FaRegBookmark color="red" size="1.5em" />
      </div>
    );
  }
}

export default IsBookMarkDetail;
